import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SearchService {
  searchedName: string;
  constructor() { 
    this.searchedName = "";
  }
  set name(name: string) {
    this.searchedName = name;
  }
  get name(): string {
    return this.searchedName;
  }
}
